import React from 'react';
import './NavBar.css';

const Button = (props) => (
    <button className='NavBar-onebutton' onClick={props.clicked}>
        {props.children}
    </button>
);

class ExpandingButton extends React.Component {
    handleClick = () => {
        console.log('this is:', this);
    }

    render() {
        return (
            <button className='NavBar-expandingbutton' onClick={this.handleClick}>
                {this.props.label}
            </button>
        );
    }
}


export {
    Button,
    ExpandingButton,
}
